import React from "react";
import CategoryCard from "../shopPages/categoryCard";

const CssClasses = {
    SLIDER: "slider",
    LIST: "navigation__list",
    ITEM: "navigation--item"
}

const Slider = ({ array }) => {

    console.log(array)

    return (
        <div className={CssClasses.SLIDER}>
            <button>←</button>
            {array.map((item) =>
                <CategoryCard item={item}/>
            )}
            <button>→</button>
        </div>
    );
};

export default Slider;
